import styled from "styled-components";


export const FooterContainer = styled.div`
   border: 1px solid #B8B8B8;
   padding: 8px;
   position: fixed;
   bottom: 700;
   left: 0; 
   width: 100%;
   height: 75px;
   display: flex;
   justify-content: center;
   align-items: center; 
   background-color: white;
   z-index: 9999;
`

export const Home = styled.img`
  margin-right: 90px;
  
`

export const Cart = styled.img`
  margin-right: 90px;
   
`
